// Layout.js

import React from 'react';

const CompanyTellUsAboutYourProjButton = () => {
  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="companyTellUsAboutYourProjButton" id="companyTellUsAboutYourProjButton">
      <p>Welcome to ABIT Solutions, where we are directing clients to their best business operations with 
        tailored and sustainable solutions.</p>
    <button className="toolbarlink" onClick={() => scrollToSection('customToolbar')}>Test</button>
    </div>

  );
};

export default CompanyTellUsAboutYourProjButton;
